import React, { Component } from 'react'

export default class TestS extends Component {
  constructor(props) {
    super(props)

    this.state = {
       count : 0
    }
    class Inc {
      constructor() {
        this.setState = () => {
          this.state.count + 1
        }
      }
    }
    }


  render() {
    return (
      <div>
        <p>{this.state.count}</p>
        <button onClick={Inc} value="click" />
      </div>
    )
  }
}
